import React from "react";
//import { NavLink } from "react-router-dom";

const About = () => {
  return (
    <div>
      <h2>Bio</h2>
    <p>
        Senior (Fall '21') computer science major at SFSU. Served as the lead back end developer for
        the CSC 648 group project. Will be setting up the back end and connecting it's front end
        together for our web app.
    </p>

    <h2>Education</h2>
    <p>San Francisco State University, B.S. Computer Science, Dec 2021</p>

    <h2>Technical Skills</h2>
    <p>Java/C++/MySQL/JS/HTML5/CSS/Node/Express</p>
    </div>
  );
};

export default About;
